import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from "./containers/login";
import './App.css';

function App() {
  return (
    
<Router>
      <Routes>
        <Route path='./containers/login' exact element={<Log/>} />
      
      </Routes>
</Router>
  );
}

export default App;
